import React from "react";
import movies from "../movies"
import Movie from "./Movie"

function Createlist(list){
    return (
        <Movie 
        title={list.title}
        poster={list.poster}
        content={list.poster}
        />
    )
}
function App(){
  
    return (
        <div>
          <dl className="dictionary">{emojipedia.map(createEntry)}</dl>
        </div>
    )
}

export default App
